import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Home, About, Contact, ErrorHandling, Login, Register } from "./pages/index";
import TemplatePage from "./pages/templatesPage/TemplatesPage";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/contact">
          <Contact />
        </Route>
        <Route path="/login">
          <Login />
        </Route>
        <Route path="/templates">
          <TemplatePage />
        </Route>
        <Route path="/errors">
          <ErrorHandling />
        </Route>
        
      </Switch>
    </Router>
  );
}

export default App;
